import {
  mdiAccountCircle,
  mdiDesktopMac,
  mdiShieldAccount,
  mdiSquareEditOutline,
  mdiTable,
  // mdiViewList,
  mdiTelevisionGuide
  // mdiResponsive
} from '@mdi/js'

export default [
  'General',
  [
    {
      to: '/dashboard',
      icon: mdiDesktopMac,
      label: 'Dashboard'
    }
  ],
  // 'Examples',
  [
    // {
    //   to: '/pizzas'

    // },
    {
      label: "Pizza's",
      icon: mdiTable,
      updateMark: true,
      menu: [
        {
          label: 'Create Pizza',
          to: '/orders',
          icon: mdiSquareEditOutline

        },
        {
          label: 'Available Pizzas'
        }
      ]
    },
    {
      to: '/customers',
      label: "Customer's",
      icon: mdiSquareEditOutline
    },
    {
      to: '/orders',
      label: "Order's",
      icon: mdiTelevisionGuide
    },
    {
      to: '/users',
      label: "User's",
      icon: mdiAccountCircle,
      menu: [
        {
          label: 'Create User'
        },
        {
          label: 'All Users'
        }
      ]
    }
  ],
  'About',
  [
    {
      href: '/',
      label: 'Developer Profile',
      icon: mdiShieldAccount
    }
  ]
]
